            title:
              'Full Stack Web Developer (Shopify\u002FJavaScript\u002FCheckoutChamp) - $5,000\u002Fm FULL TIME',
            description:
              "Our 8-figure ecommerce brand is seeking a full-time FULL-STACK web developer with 6+ years of experience, capable of creating ANY feature with JavaScript. You’ll be responsible for our funnels on Shopify and Checkout Champ, developing custom features and high-converting designs.\n\nPerks:\n\n- Experience the thrill of a fast-paced startup environment\n- Get more and more responsibilities and face diverse projects daily\n- Flexible schedule at $15\u002Fh with performance bonuses (earn $3,000\u002F$5,000 a month)\n- Opportunity to grow and become a manager in a rapidly scaling business\n\nRequirements:\n\n- Full-stack with 6+ years experience in web development and design, with a focus on ecommerce platforms like Shopify\n- Experienced with marketing tools (e.g. email\u002Fsms automations), tracking (Facebook Pixel, Google Analytics, Google Tag Manager), and custom event tracking using JavaScript\n- Expert-level proficiency in: HTML5, CSS3, and JavaScript (including modern frameworks like React or Vue.js)\n- RESTful APIs and web services integration\n- Version control systems (e.g., Git)\n- Good understanding of JS video players\n- Experience with performance optimization, security best practices, and scalable architecture\n- Experience with server-side optimization and CDN implementation\n\nSoft Skills and Attributes:\n\n- Exceptional problem-solving skills with a proactive, solution-oriented mindset\n- Ability to work independently and manage multiple projects simultaneously\n- Excellent written and verbal communication skills in English\n- Adaptability to fast-paced environments and changing priorities\n- Demonstrated ability to meet tight deadlines without compromising quality\n- Strong attention to detail with a data-driven approach to decision-making\n\nResponsibilities:\n\n- Develop custom features for ecommerce funnels on Shopify and Checkout Champ, solving complex challenges with creative solutions.\n- Code new pages in HTML or Shopify Liquid based on designs, focusing on mobile optimization, load speed, and conversion rate.\n- Identify and fix bugs, performance issues, and bottlenecks, conducting audits for smooth user experiences.\n- Run A\u002FB tests on web pages, analyze data, and report insights for data-driven decisions.\n- Integrate various platforms, connecting payment processors, email\u002FSMS systems, and automations like Zapier.\n- Collaborate with marketing teams to implement tracking and analytics solutions (e.g., custom event tracking, pixel integration) for campaigns and promotions.\n\nSalary & Schedule:\n\nWe offer a flexible full-time position with the following terms:\n- Standard availability: Monday to Friday, 8 hours per day\n- Base pay: $15 per hour, tracked using TimeDoctor\n- Potential monthly earnings: $2,600 to $3,600, depending on hours worked\n- Performance bonuses: Up to $2000 for proactive solutions that significantly impact the company's bottom line. Example: Developing a method to recover declined transactions, resulting in increased revenue\n\nWe value initiative and reward results. Your innovative solutions can directly boost your earnings while contributing to the company's success.\n\nAbout the company:\n\nFounded in Italy, we are a growing skincare brand specializing in acne treatment and anti-aging solutions. Originating from the founder's personal struggle with acne, we now primarily operate in the US. We have improved the skin of over 100,000 women, collaborated with 600 influencers, and partnered with a celebrity doctor as the face of our marketing campaigns.\n\nTo apply:\nWe're looking for someone to start immediately (within October 7-11). After you apply, you will answer the 5 questions in the application form (Look video required). Shortlisted candidates will be contacted on Upwork and receive a brief test. If you pass the test, a video interview will follow before onboarding.",
