            description:
              'Job Type: Freelance \u002F Contract\nLocation: Remote (Availability on EST Time Zone Required)\nCompany: Kean On Biz - Business Consultancy & IT Development\n\nAbout Us:\nKean On Biz is a leading business consultancy and IT development firm dedicated to helping businesses grow and succeed with cutting-edge technology solutions. We are seeking a highly skilled and versatile Full Stack Developer for an immediate project with potential for ongoing work.\n\nRole Overview:\nWe are looking for an experienced Full Stack Developer with a strong focus on UI development, MongoDB, AWS, and AI tools like OpenAI. The ideal candidate should have a proven track record of delivering high-quality, scalable solutions and must be fluent in English (both written and spoken). You will be working closely with our project team to develop and maintain robust web applications, as well as integrate AI functionalities where needed. \n\nAvailability to collaborate during EST time zone hours is essential.\n\nKey Responsibilities:\n\n-Design, develop, and maintain full stack web applications.\n-Collaborate with UI\u002FUX designers to create responsive and intuitive user interfaces.\n-Develop and optimize backend services using MongoDB and AWS.\n-Integrate and connect AI tools (e.g., OpenAI, GPT APIs, etc.) to enhance application functionalities.\n-Troubleshoot, debug, and upgrade existing software.\n-Ensure the performance, security, and scalability of applications.\n-Work within a collaborative environment, following agile methodologies.\n-Provide clear communication and updates on project progress.\n-Required Skills and Qualifications:\n\n-Full Stack Development experience, with expertise in both frontend (UI) and backend.\n-Strong knowledge of UI development, including responsive design and modern frontend frameworks (e.g., React, Angular, or Vue.js).\n-Proficiency with MongoDB for database management and optimization.\n-Experience with AWS (EC2, S3, RDS, etc.) for deploying and managing cloud-based applications.\n-Experience integrating and utilizing AI tools such as OpenAI, GPT APIs, or similar AI technologies.\n-Familiarity with DevOps practices and version control (Git).\n-Ability to write clean, maintainable, and well-documented code.\n-Excellent problem-solving skills and attention to detail.\n-Fluent in English (both written and spoken).\n-Availability on EST time zone for collaboration and meetings.\n-Able to start immediately.\n\nPreferred Qualifications:\n\n-Experience working in a fast-paced, agile development environment.\n-Familiarity with microservices architecture.\n-Knowledge of serverless architecture using AWS Lambda.\n-Experience integrating third-party APIs.\n-Previous experience with AI-driven applications or chatbots.\n\nBenefits:\n\n-Flexible remote work environment.\n-Competitive freelance\u002Fcontract rates.\n-Opportunity for ongoing work on exciting, cutting-edge projects.\n-Collaborative, innovative team environment.\n\nHow to Apply: If you meet the above requirements and are available for immediate hire, please send your resume, portfolio, and a brief cover letter highlighting your relevant experience, including proficiency with AI tools, and your availability to work on EST time.\n\nWe look forward to hearing from you and exploring how we can work together on this exciting project and beyond!',
