            title:
              'Software Developer with FFMPEG (video) & Streaming Experience',
            description:
              'Overview:\nWe’re looking for a skilled software developer to join our team. If you’ve got experience with video tech, especially FFMPEG and streaming, this could be a great fit for you. This is a full-time, 40-hour-per-week role, and we’re looking for someone who’s in it for the long haul—there’s plenty of room to grow with us as we continue expanding.\n\nWhat You’ll Be Doing:\n\nBuilding new applications and improving existing ones using NodeJS, NestJS (our API framework), and Svelte (frontend).\nWorking with Google Cloud to create scalable, cloud-based solutions.\nTackling video encoding with FFMPEG and handling streaming-related tasks.\nCollaborating on Python projects.\nWorking closely with our customer support and dev teams to squash bugs and solve issues for our users.\nJoining our daily standups (via Slack bot), weekly meetings, and regular check-ins to stay in sync with the team.\nWhat We’re Looking For:\n\nSolid experience with FFMPEG and streaming technologies.\nStrong skills with NodeJS, especially NestJS for APIs.\nExperience with Svelte or similar frontend frameworks.\nA good grasp of Python for backend tasks.\nComfortable working with cloud infrastructure (Google Cloud experience is a plus).\nSelf-sufficient and proactive - with the ability to tackle tasks independently without needing constant guidance.\n\nWho You’ll Be Working With:\nYou’ll be working alongside me (the Lead Developer) and the rest of the dev and support teams. We’ve got a great group here, and collaboration is key. We want someone who can jump in and contribute right away.\n\nWhat’s It Like Here?\nWe’ve got a great rhythm going. Daily standups to keep everyone on the same page, weekly meetings for deeper dives, and regular check-ins to make sure nothing falls through the cracks. We’ve built a really supportive and collaborative environment, so even though you’ll have a lot of autonomy, you’ll never feel like you’re on your own.\n\nWhy This is a Great Opportunity:\nI’ve been with the company for over 4 years now, and in that time, we’ve gone from a total startup to a serious player in our niche. It’s been an incredible journey, and personally, I’ve grown so much. I can honestly say I wouldn’t want to be anywhere else or work with anyone else.\n\nIf you’re looking for a place where you can really make an impact and grow alongside the company, this is it. We’re passionate about what we do, and we’re looking for someone who feels the same way.\n\nHow to Apply:\nShoot over your resume and any relevant projects where you’ve worked with FFMPEG, NodeJS, or streaming tech. Looking forward to hearing from you!',
